import logo from './logo.svg';
import './App.css';
import Form from './components/Form/Form';
import Image from './components/Image/Image';
import { Component } from 'react';
// import React from 'react';

class App extends Component {

  constructor(props) {
    super(props);
    this.state = {
      memes: {}
    };
  }

  getMemes() {
    fetch('http://localhost:2000/memes',{ mode: 'no-cors' })
      .then(response => response.json())
      .then((result)=> {
        this.setState({
          memes: result.memes
        });
      },
      (error) => {
        this.setState({
          error
        });
      }
      )
  }

  render() {
    return (
      <div className="">
          <Form />
          <Image />
          <div>
          { this.getMemes}
          </div>

      </div> 
    );
  }
}


export default App;
